<?php

namespace Opencity;

use Silex\Application;
use Symfony\Component\HttpFoundation\Request;
use Symfony\Component\HttpFoundation\Response;
use Symfony\Component\HttpFoundation\JsonResponse;
use Codebird\Codebird;


class Selfie
{
    private function getTwitter(){
        $twit = __DIR__ . '/../config/twit.json';
        if ( file_exists($twit) ) {
            $twitJson = file_get_contents($twit);
            $twitData = json_decode($twitJson);

            \Codebird\Codebird::setConsumerKey($twitData->key, $twitData->key_secret);
            $cb = \Codebird\Codebird::getInstance();
            $cb->setToken($twitData->token, $twitData->token_secret);
        }
        return isset($cb) ? $cb : false;
    }

    public function saveImage(Application $app, Request $request)
    {
        //$imageData = "data:image/png;base64,";
        $imageData = $request->get('image');

        list($type, $data) = explode(';', $imageData);
        list(, $data)      = explode(',', $data);
        $data = base64_decode($data);

        $fileName = __DIR__.'/../selfies/'.mktime().'.png';
        if ( FALSE == file_put_contents($fileName, $data) ) {

            $response = new JsonResponse('Bad Request', 400);
        }else {
            $response = new JsonResponse('Your image - added to the Face of Peterborough!', 200);
            if ( $cb = $this->getTwitter() ){

                $params = array(
                    'status' => "I am the face of Peterborough's OpenCity",
                    'media[]' => realpath($fileName)
                );
                $reply = $cb->statuses_updateWithMedia($params);
            }

        }

        return $response;
    }
}